import { GoogleApiWrapper, Map, Marker } from "google-maps-react";
import React, { useEffect } from "react";

const GoogleMap = (props) => {
  console.log(props);

  const mapStyles = {
    width: "50%",
    height: "50%",
    border: "2px solid red",
  };
  // Geocode.setApiKey("AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8");
  // Geocode.enableDebug();

  // let x = Geocode.fromAddress("Eiffel Tower").then(
  //   (response) => {
  //     const { lat, lng } = response.results[0].geometry.location;
  //     console.log(lat, lng);
  //   },
  //   (error) => {
  //     console.error(error);
  //   }
  // );
  // console.log(x)

  useEffect(() => {
    fetch(
      "https://maps.googleapis.com/maps/api/geocode/json?address=dhaka&key=AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8"
    )
      .then((res) => console.log(res))
      .then((err) => console.log(err));
  }, []);

  return (
    <div>
      <Map
        google={props.google}
        zoom={8}
        style={mapStyles}
        initialCenter={{ lat: 23.810331, lng: 90.412521 }}
      >
        <Marker position={{ lat: 23.810331, lng: 90.412521 }} />
      </Map>
      <hr />
    </div>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8",
})(GoogleMap);
